import { body, button, div, doctype, h1, head, html,
         link, main, pre, script, title } from './elements.js'

const favicon = 'data:image/x-icon;base64,'

const counter = (count = 0) =>
  div(
    pre(
      { style:
        { fontSize: '4em',
          margin: '20px 0' } },
      count),
    button(
      { onclick: () => counter(count + 1) },
      'Increment'))

html(
  doctype('html'),
  head(
    title('Expressive'),
    link({ href: favicon, rel: 'icon' }),
    script({ src: '//localhost:35729/livereload.js?snipver=' }),
    script({ src: '/index.js', type: 'module' })),
  body(
    { style:
      { background: '#222',
        color: '#eee',
        textAlign: 'center' } },
    main(
      h1('Recursive counter'),
      counter(),
      counter())))

